INSERT INTO `etp_category` (`catid`, `content`, `max_point`, `status`) VALUES
(1, 'Ý thức tham gia học tập', 20, 1),
(2, 'Ý thức chấp hành nội quy, quy chế, quy định trong nhà trường ', 25, 1),
(3, 'Ý thức tham gia các hoạt động chính trị - xã hội, văn hóa, văn nghệ, thể thao, phòng chống các tệ nạn xã hội ', 20, 1),
(4, 'Ý thức công dân trong quan hệ cộng đồng ', 25, 1),
(5, 'Ý thức và kết quả tham gia công tác cán bộ lớp, các đoàn thể, tổ chức khác trong nhà trường hoặc sinh viên đạt được thành tích đặc biệt trong học tập, rèn luyện', 10, 1);
INSERT INTO `etp_criteria` (`cid`, `parent_cid`, `content`, `point`, `status`, `group_id`) VALUES
(1, NULL, 'Đi học đầy đủ, đúng giờ, nghiêm túc, không bỏ tiết…', '0 - 5 điểm', 1, 1),
(2, NULL, 'Không vi phạm quy chế về thi, kiểm tra', '5 điểm', 1, 1),
(3, NULL, 'Bị cấm thi kết thúc học phần', '-5 điểm', 1, 1),
(4, NULL, 'Vi phạm qui chế thi bị lập biên bản', '-2 điểm', 1, 1),
(5, NULL, '<table class=\"criteria-detail\">\r\n                        <tr>\r\n                            <td>Yếu, kém</td>\r\n                            <td>Trung bình</td>\r\n                            <td>Trung bình khá</td>\r\n                            <td>Khá</td>\r\n                            <td>Giỏi</td>\r\n                            <td>Xuất sắc</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>0 điểm</td>\r\n                            <td>2 điểm</td>\r\n                            <td>4 điểm</td>\r\n                            <td>6 điểm</td>\r\n                            <td>8 điểm</td>\r\n                            <td>10 điểm</td>\r\n                        </tr>\r\n                    </table>', '0 – 10 điểm\r\n', 1, 2),
(6, NULL, 'Tham gia các buổi hội thảo học thuật/ Tham gia các hội thi học thuật do Đoàn – Hội, Khoa, Trường tổ chức', '1 điểm/lần', 1, 3),
(7, NULL, 'Tham gia nghiên cứu khoa học (đạt yêu cầu, được giảng viên hướng dẫn xác nhận; không tính các bài tập, tiểu luận, đồ án môn học, luận văn)/ Có bằng khen, giấy khen về nghiên cứu khoa học/ Có bài nghiên cứu khoa học được đăng trên tạp chí, nội san (Nộp minh chứng):<br>\r\n<table>\r\n    <tr>\r\n        <td>Cấp Khoa</td>\r\n        <td>Cấp Trường</td>\r\n        <td>Cấp Bộ</td>\r\n    </tr>\r\n    <tr>\r\n        <td>2 điểm/lần</td>\r\n        <td>4 điểm/lần</td>\r\n        <td>6 điểm/lần</td>\r\n    </tr>\r\n</table>', '2 – 6 điểm/lần', 1, 3),
(8, NULL, 'Có hành vi gây ảnh hưởng xấu đến công tác tổ chức các hoạt động', '-3 điểm/lần', 1, 3),
(9, NULL, '- Tham gia học tập Tuần sinh hoạt công dân hàng năm:<br>\r\n<table>\r\n    <tr>\r\n        <td>Không tham gia</td>\r\n        <td>Không đầy đủ</td>\r\n        <td>Đầy đủ</td>\r\n    </tr>\r\n    <tr>\r\n        <td>0 điểm/lần</td>\r\n        <td>2 điểm/lần</td>\r\n        <td>5 điểm/lần</td>\r\n    </tr>\r\n</table>', NULL, 1, 4),
(10, NULL, 'Không vi phạm các nội quy, quy chế, quy định trong Nhà Trường', '12 điểm', 1, 4),
(11, NULL, 'Tuyên truyền và tham gia các hoạt động nâng cao ý thức của sinh viên trong việc chấp hành nội quy, quy chế, quy định trong Nhà Trường, các hoạt động giữ gìn môi trường, bảo vệ tài sản, thực hành tiết kiệm, bảo vệ an ninh trật tự…', '0 - 8 điểm', 1, 4),
(12, NULL, 'Bị xử lý kỷ luật về công tác sinh viên:', NULL, 1, 4),
(13, 12, 'Mức khiển trách', '-5 điểm', 1, 4),
(14, 12, 'Mức cảnh cáo', '-10 điểm', 1, 4),
(15, NULL, 'Tham gia các hoạt động chính trị - xã hội, văn hóa, văn nghệ, thể thao, phòng chống tệ nạn xã hội do Lớp, Khoa, Trường tổ chức', '0 -10 điểm', 1, 5),
(16, NULL, 'Thành viên tích cực các đội hình văn nghệ, thể thao, công tác xã hội…', NULL, 1, 5),
(17, 16, 'Cấp Khoa (Đội trưởng xác nhận)', '2 điểm', 1, 5),
(18, 16, 'Cấp Trường (Phòng CTSV xác nhận)', '5 điểm', 1, 5),
(19, NULL, 'Tham gia chiến dịch Mùa hè xanh, Xuân tình nguyện, tiếp sức mùa thi… do Trường, Đoàn – Hội tổ chức', '5 điểm', 1, 5),
(20, NULL, 'Được kết nạp Đảng Cộng sản Việt Nam', '15 điểm', 1, 5),
(21, NULL, 'Tham gia các hoạt động rèn luyện về chính trị, xã hội, văn nghệ, thể thao và đạt giải thưởng:\r\n<table><tr><td>Cấp Trường</td><td>Cấp thành</td><td>Cấp bộ</td></tr><tr><td>3 điểm/lần</td><td>5 điểm/lần</td><td>7 điểm/lần</td></tr></table>', '3 –7 điểm/lần', 1, 5),
(22, NULL, 'Không bị cơ quan an ninh hoặc cơ quan Nhà nước có thẩm quyền gửi thông báo vi phạm công tác giữ gìn an ninh trật tự, an toàn xã hội, an toàn giao thông tại địa phương về Trường', '10 điểm', 1, 6),
(23, NULL, 'Có tinh thần giúp đỡ bạn bè gặp khó khăn trong học tập, trong cuộc sống (được tập thể lớp và GVCN xác nhận)', '0 – 5 điểm', 1, 6),
(24, NULL, 'Không chia rẽ bè phái, gây bất hòa, xích mích trong nội bộ, làm ảnh hưởng đến tinh thần đoàn kết của tập thể', '5 điểm', 1, 6),
(25, NULL, 'Được biểu dương, khen thưởng (từ cấp trường trở lên) về tham gia giữ gìn trật tự an toàn xã hội, về thành tích đấu tranh bảo vệ pháp luật, về hành vi giúp người, cứu người ((Nộp minh chứng)', '10 điểm', 1, 6),
(26, NULL, 'Vi phạm pháp luật, hành chánh ở địa phương cư trú, Ký túc xá, có công văn gửi về Trường', '-10 điểm', 1, 6),
(27, NULL, 'Có các hành vi không đúng mực trong lớp, trong Trường, gây chia rẽ bè phái làm mất đoàn kết trong tập thể; bản thân gây ảnh hưởng không tốt đối với tập thể', '-10 điểm', 1, 6),
(28, NULL, 'Ban Cán sự lớp; Ban Chấp hành Đoàn – Hội các cấp; Ban Chủ nhiệm các câu lạc bộ, đội, nhóm các cấp hoàn thành nhiệm vụ (theo đề nghị của GVCN/ Cố vấn học tập, các đoàn thể):<table><tr><td>Không hoàn thành</td><td>Trung bình</td><td>Khá</td><td>Tốt</td><td>Xuất sắc</td></tr><tr><td>0 điểm</td><td>4 điểm</td><td>6 điểm</td><td>8 điểm</td><td>10 điểm</td></tr></table> ', '0 – 10 điểm', 1, 7),
(29, NULL, 'Đạt được thành tích đặc biệt trong học tập, rèn luyện (được khen thưởng cấp: Trường, Thành phố, Quốc gia, Quốc tế) (Nộp minh chứng)', '6 – 10 điểm', 1, 7),
(30, NULL, 'Tích cực tham gia công tác cán bộ lớp, công tác Đoàn TN, Hội SV', '0 – 5 điểm', 1, 7);
