INSERT INTO `savsoft_notification` (`nid`, `title`, `message`, `uid`, `created_date`, `last_updated`, `start_date`, `end_date`) VALUES
(9, 'TB thời gian thực hiện bài thu hoạch', '<p>Thời gian mở cổng thông tin để sinh viên làm bài bắt đầu từ ngày 09/9/2019 đến ngày 14/9/2019, cụ thể như sau:</p>\r\n\r\n<ul>\r\n	<li>Ngày<strong> </strong>09/09/2019: Khoa Cơ khí, Công nghệ thực phẩm</li>\r\n	<li>Ngày 10 và 11/09/2019: Khoa Công nghệ thông tin và Design</li>\r\n	<li>Ngày 12 và 13/09/2019: Khoa Quản trị kinh doanh</li>\r\n	<li>Ngày 14/09/2019: Khoa Điện - Điện tử và Kỹ thuật công trình</li>\r\n</ul>\r\n\r\n<p>- Sau thời gian trên cổng thông tin làm bài thu hoạch “Tuần SHCD – Sinh viên” năm học 2019-2020 sẽ đóng. Sinh viên cần thực hiện đúng theo thời gian phân bổ để đảm bảo hoàn tất việc làm bài thu hoạch Tuần SHCD-SV năm 2019-2020.</p>\r\n\r\n<p>- Mọi ý kiến thắc mắc sinh viên liên hệ trực tiếp Phòng Công tác Sinh viên (Phòng A.406) hoặc email ctsv@stu.edu.vn để được hướng dẫn, hỗ trợ.</p>\r\n', 4287, '2019-09-04 17:20:02', '0000-00-00 00:00:00', '2019-09-05 00:19:21', NULL),
(10, 'Tài liệu tham khảo', '<p><a href=\"/images/files/Slide_bai_giang.rar\">Slide bài giảng</a></p>\r\n', 4287, '2019-09-07 14:56:48', '2019-09-07 14:56:48', '2019-09-07 00:00:00', '2019-10-07 00:00:00'),
(11, 'TB thời gian làm bài thu hoạch đầu khóa', '<p>Thời gian mở cổng thông tin làm bài thu hoạch \"Tuần SHCD - Sinh viên\" đầu khóa - Khóa 2019 bắt đầu từ ngày 25/9/2019 đến ngày 28/09/2019.</p>\r\n\r\n<p>- Sau thời gian trên cổng thông tin làm bài thu hoạch “Tuần SHCD – Sinh viên” năm học 2019-2020 sẽ đóng. Sinh viên cần thực hiện đúng theo thời gian phân bổ để đảm bảo hoàn tất việc làm bài thu hoạch Tuần SHCD-SV năm 2019-2020.</p>\r\n\r\n<p>- Mọi ý kiến thắc mắc sinh viên liên hệ trực tiếp Phòng Công tác Sinh viên (Phòng A.406) hoặc email ctsv@stu.edu.vn để được hướng dẫn, hỗ trợ.</p>\r\n', 4278, '2019-09-23 02:27:57', '2019-09-23 13:59:22', '0000-00-00 00:00:00', NULL);
