(842, 156, 'Hình thức cho vay, đi vay hoặc huy động vốn với lãi suất vượt quá mức lãi suất pháp luật quy định, được thực hiện bởi các cá nhân, nhóm người hoặc tổ chức kinh doanh dịch vụ tài chính', NULL, 0),
(843, 156, 'Hình thức cho vay, đi vay hoặc huy động vốn với lãi suất vượt quá mức lãi suất pháp luật quy định, được thực hiện bởi các cá nhân, nhóm người hoặc tổ chức kinh doanh dịch vụ tài chính, thường gắn với các hành vi đòi nợ, chiếm đoạt tài sản trái pháp luật.', NULL, 1),
(844, 157, 'Nâng cao nhận thức, ý thức trách nhiệm và năng lực hành động của cán bộ quản lý, nhà giáo nhân viên, người lao động trong công tác Phòng ngừa tội phạm và phòng, chống vi phạm pháp luật.', NULL, 0),
