(846, 157, 'Phòng ngừa hiệu quả, làm giảm tội phạm, vi phạm pháp luật trong học sinh, sinh viên góp phần xây dựng môi trường giáo dục an toàn, lành mạnh, thân thiện.', NULL, 0),
