(872, 128, 'Nâng cao chất lượng công tác giáo dục chính trị, tư tưởng làm cho toàn Đảng, toàn quân dân nhận thức sâu sắc hơn: các nội dung cơ bản và giá trị to lớn của CN Mác – Lênin, tư tưởng HCM thật sự trở thành nền tảng tinh thần trong đời sống xã hội; Làm rõ cơ sở lý luận, thực tiễn, hoàn thiện hệ thống lý luận về CNXH và con đường đi lên CNXH trong tình hình mới; khẳng định và cụ thể hóa nguyên lý cơ bản, giá trị bền vững, phù hợp thực tiễn VN; bổ sung, phát triển, sáng tạo.', NULL, 0),
(873, 128, 'Tăng cường lãnh đạo, chỉ đạo và thực hiện kiểm tra, giám sát tổ chức đảng, đảng viên; kiên quyết xử lý kịp thời, nghiêm minh các trường hợp vi phạm; ngăn chặn kịp thời và xử lý nghiêm các đối tượng chống đối, cơ hội, bất mãn chính trị.', NULL, 0),
(874, 128, 'Phát huy vai trò báo chí, truyền thông cần đổi mới nội dung, phương thức, nâng cao chất lượng và hiệu quả công tác tuyên truyền; Nâng cao chất lượng, hiệu quả quản lý và sử dụng internet, mạng xã hội trong tình hình mới; Thành lập Ban Chỉ đạo Trung ương về bảo vệ nền tảng tư tưởng của Đảng, đấu tranh phản bác các quan điểm sai trái, thù địch.', NULL, 0),
