(884, 166, 'Vì muốn cứu nước và giải phóng dân tộc không có con đường nào khác con đường cách mạng vô sản.', NULL, 0),
(885, 166, 'Vì chủ nghĩa Mác, Lê nin, tư tưởng Hồ Chí Minh là nguồn sáng dẫn đường cho cách mạng Việt Nam đi đến thắng lợi cuối cùng.', NULL, 0),
