(1, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Đối tượng nào sau đây không thuộc diện xét miễn giảm học phí tại trường?</span></span></p>\r\n', '', 1, 1, 1733, 1529, 176, 28),
(2, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Có bao nhiêu đối tượng Sinh viên được xét giảm học phí tại trường?</span></span></p>\r\n', '', 1, 1, 1590, 618, 949, 23),
(3, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Điểm trung bình ở học kỳ hoặc năm học trước để xét giảm học phí đối với Sinh viên là từ bao nhiêu điểm?</span></span></p>\r\n', '', 1, 1, 1700, 795, 875, 30),
(4, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:\"Times New Roman\",serif\">Điểm trung bình ở học kỳ hoặc năm học trước để xét giảm học phí đối với đối tượng anh, chị em ruột đang học tại trường là từ bao nhiêu điểm? </span></span></p>\r\n', '', 1, 1, 1654, 751, 883, 20),
(5, 'Nhiều lựa chọn Một câu trả lời', '<p>Danh hiệu thi đua khen thưởng đối với cá nhân dành cho Sinh viên đạt thành tích học tập?</p>\r\n', '', 1, 1, 1772, 1472, 281, 19),
(6, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:\"Times New Roman\",serif\">Xác nhận của đơn vị nào không được nhà trường công nhận khi sinh viên tham gia chương trình công tác xã hội?</span></span></p>\r\n', '', 1, 1, 1695, 628, 1054, 13),
(7, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Trong toàn khóa học Sinh viên hệ Cao đẳng phải tích lũy đủ bao nhiêu ngày CTXH?</span></span></p>\r\n', '', 1, 1, 1690, 1302, 373, 15),
(8, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sinh viên chưa hoàn thành đủ số ngày công tác xã hội sẽ bị xử lý thế nào?</span></span></p>\r\n', '', 1, 1, 1698, 1043, 636, 19),
(9, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sau khi có kết quả số ngày CTXH tạm thời sinh viên có bao nhiêu ngày để thực hiện quyền khiếu nại?</span></span></p>\r\n', '', 1, 1, 1682, 740, 914, 28),
(10, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Theo quy định quy đổi ngày CTXH, Sinh viên thực hiện công việc từ bao nhiêu giờ thì được tính 1 ngày CTXH?</span></span></p>\r\n', '', 1, 1, 1622, 1092, 514, 16),
(23, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:\"Times New Roman\",serif\">Theo bạn dấu hiệu khác biệt trong phương pháp học đại học so với học phổ thông là gì?</span></span></p>\r\n', '', 1, 1, 1634, 1311, 311, 12),
(24, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Khi cần tìm hiểu về một vấn đề bạn sẽ tìm thông tin ở đâu?</span></p>\r\n', '', 1, 1, 1681, 1648, 21, 12),
(25, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Nơi nào cung cấp các khóa học miễn phí trên internet?</span></p>\r\n', '', 1, 1, 1732, 1116, 599, 17),
(26, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Sinh viên thiếu chuyên cần sẽ bị cấm thi khi nào?</span></p>\r\n', '', 1, 1, 1614, 997, 601, 16),
