(146, 'Nhiều lựa chọn Một câu trả lời', 'Những lưu ý khi sử dụng facebook là gì?\r\n1.Tuyệt đối không được nói tục, chửi bậy hoặc văng bậy, kể cả chửi bậy bằng những thứ viết tắt. Phải sử dụng ngôn ngữ trong sáng, thuần Việt.\r\n2.Chỉ like Status khi đã đọc kỹ nội dung của nó. Nếu like những status có nội dung xấu, chủ nhân Facebook sẽ bị quy trách nhiệm. Bởi vậy, cần phải biết đấu tranh, bảy tỏ quan điểm trước status có nội dung xấu hoặc không lành mạnh.\r\n3.Tuyệt đối, không được để bạn bè hiểu lầm khi đọc status. Bởi vậy viết status phải rõ ràng.\r\n4.Facebook cũng là nơi thể hiện được sự văn hóa của mỗi cá nhân, bởi vậy nên cân nhắc kỹ trước khi lên like vào một comment nào đó, hoặc viết status thể hiện tâm trạng của bản thân.\r\n5.Facebook không phải là nhật ký, bởi thế mọi riêng tư không nên đưa lên Facebook.', '', 10, 1, 575, 245, 320, 10),
(147, 'Nhiều lựa chọn Một câu trả lời', 'Hệ thống thông tin quan trọng về an ninh quốc gia trừ thông tin quân sự và thông tin cơ yếu thuộc Ban Cơ yếu Chính phủ do ai thẩm định?', '', 6, 1, 1245, 248, 987, 10),
