(157, 'Nhiều lựa chọn Một câu trả lời', '<p>Mục ti&ecirc;u chung của Đề &aacute;n &ldquo; Ph&ograve;ng ngừa tội phạm v&agrave; ph&ograve;ng, chống vi phạm ph&aacute;p luật trong học sinh sinh vi&ecirc;n đến năm 2020&rdquo; l&agrave;:</p>\r\n', '', 1, 1, 1687, 1566, 114, 7),
(158, 'Nhiều lựa chọn Một câu trả lời', '<p>Vai tr&ograve; của Sinh vi&ecirc;n trong việc Ph&ograve;ng ngừa tội phạm v&agrave; ph&ograve;ng, chống vi phạm ph&aacute;p luật l&agrave; g&igrave;?</p>\r\n', '', 1, 1, 1649, 1596, 46, 7),
(159, 'Nhiều lựa chọn Một câu trả lời', '<p>Chỉ thị 12/CT-TTg ng&agrave;y 25/4/2019 về tăng cường ph&ograve;ng ngừa, đấu tranh với tội phạm v&agrave; vi phạm ph&aacute;p luật li&ecirc;n quan đến &ldquo;t&iacute;n dụng đen&rdquo; Thủ tướng Ch&iacute;nh phủ y&ecirc;u cầu đối với Bộ GD&amp;ĐT l&agrave; g&igrave;?</p>\r\n', '', 1, 1, 1645, 1453, 183, 9),
