(161, 'Nhiều lựa chọn Một câu trả lời', '<p>C&oacute; bao nhi&ecirc;u điều quy định về văn h&oacute;a trong Qui định về &quot;Văn h&oacute;a STU&quot;?</p>\r\n', '', 1, 1, 1699, 963, 717, 19),
(162, 'Nhiều lựa chọn Một câu trả lời', '<p>Đối tượng &aacute;p dụng trong quy định về Văn h&oacute;a&nbsp;STU bao gồm:</p>\r\n', '', 1, 1, 1658, 1472, 176, 10),
(163, 'Nhiều lựa chọn Một câu trả lời', '<p>Quy định: &quot; Ăn mặc nghi&ecirc;m chỉnh, lịch sự, gọn g&agrave;ng, sạch sẽ v&agrave; khi v&agrave;o Trường, mặc đồng phục (theo quy định, nếu c&oacute;), đeo ph&ugrave; hiệu hoặc bảng t&ecirc;n theo quy định;&quot; d&agrave;nh cho đối tượng n&agrave;o v&agrave; thuộc quy định về văn h&oacute;a n&agrave;o trong quy định về &quot;Văn h&oacute;a STU&quot;?</p>\r\n', '', 1, 1, 1694, 1049, 631, 14),
(164, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Tư tưởng Hồ Chí Minh được chính thức đưa vào văn kiện từ Đại hội lần thứ mấy của Đảng?</span></span></p>\r\n', '', 7, 1, 2868, 1528, 1300, 40),
(165, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Vì sao Nguyễn Ái Quốc cho rằng cách mạng tư sản chỉ là cuộc cách mạng nửa vời, không triệt để?</span></span></p>\r\n', '', 7, 1, 2830, 1292, 1492, 46),
(166, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Vì sao Đảng lấy Chủ nghĩa Mác, Lê nin, tư tưởng Hồ Chí Minh là nền tảng tư tưởng, kim chỉ nam cho mọi hành động của Đảng ta?</span></span></p>\r\n', '', 7, 1, 2889, 2604, 247, 38),
(167, 'Nhiều lựa chọn Một câu trả lời', '<p>Nhà Thanh có ao bèo 1.000m2, ngày hôm sau số lượng bèo sẽ nở gấp đôi ngày hôm trước, đến ngày thứ 18 thì bèo đã nở được nửa ao. Vậy đến ngày thứ bao nhiêu thì bèo sẽ nở đầy ao?</p>\r\n', '', 11, 1, 1154, 480, 537, 137),
(168, 'Nhiều lựa chọn Một câu trả lời', '<p>9 – 6 - 1; 27 – 1 - 2; 6 - 3 - ?</p>\r\n', '', 11, 1, 1166, 376, 612, 178),
(169, 'Nhiều lựa chọn Một câu trả lời', '<p>Số tiếp theo của dãy 19, 28, 37, 46, ... là số nào? </p>\r\n', '', 11, 1, 1143, 834, 149, 160),
(170, 'Nhiều lựa chọn Một câu trả lời', '<p>Hãy tính dãy số sau đây: 1 + 2 + 3 + ..... + 99 = ...........</p>\r\n', '', 11, 1, 1187, 487, 540, 160),
(171, 'Nhiều lựa chọn Một câu trả lời', '<p>Minh 4 tuổi, tuổi anh Minh gấp 3 lần tuổi Minh. Khi anh Minh bao nhiêu tuổi thì tuổi anh Minh chỉ còn gấp đôi tuổi Minh? </p>\r\n', '', 11, 1, 1194, 528, 479, 187),
(172, 'Nhiều lựa chọn Một câu trả lời', '<p>John có 10 đôi tất. Nếu anh ta mất 7 chiếc tất riêng lẻ thì số đôi nhiều nhất mà anh ta còn lại là bao nhiêu? </p>\r\n', '', 11, 1, 1188, 508, 544, 136),
(173, 'Nhiều lựa chọn Một câu trả lời', '<p>Một đội bóng rổ chơi được 2/3 trận đấu và đã thắng 17 bàn, thua 3 bàn. Trong suốt trận đấu còn lại đội bóng có thể thua nhiều nhất bao nhiêu mà vẫn thắng ít nhất 3/4 toàn trận đấu?</p>\r\n', '', 11, 1, 1188, 269, 750, 169),
(174, 'Nhiều lựa chọn Một câu trả lời', '<p>Các đồng xu được thả vào một cái hộp với tốc độ 2 fit khối/giờ. Nếu một hộp rỗng có kích thước là dài 4 fit, rộng 4 fit và sâu 3 fit, sẽ mất bao lâu để đôt đầy chiếc hộp đó? </p>\r\n', '', 11, 1, 1128, 380, 604, 144),
(175, 'Nhiều lựa chọn Một câu trả lời', '<p>Nếu x và y là các số nguyên tố thì các giá trị nào trong các giá trị sau không thể là tổng của x và y?</p>\r\n', '', 11, 1, 1167, 259, 759, 149),
(176, 'Nhiều lựa chọn Một câu trả lời', '<p>Tiền thuê 1 chỗ đậu xe trong gara là 10 đôla/tuần hoặc 30 đôla/tháng. Một người có thể tiết kiệm được bao nhiêu tiền trong 1 năm nếu thuê theo tháng?</p>\r\n', '', 11, 1, 1185, 262, 751, 172),
(177, 'Nhiều lựa chọn Một câu trả lời', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Đối tượng nào sau đây không thuộc diện xét miễn giảm học phí tại trường?</span></span></span></span></p>\r\n', '', 12, 1, 6, 6, 0, 0),
(178, 'Nhiều lựa chọn Một câu trả lời', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Có bao nhiêu đối tượng Sinh viên được xét giảm học phí tại trường?</span></span></span></span></p>\r\n', '', 12, 1, 4, 0, 4, 0),
(179, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Điểm trung bình ở học kỳ hoặc năm học trước để xét giảm học phí đối với Sinh viên là từ bao nhiêu điểm?</span></span></p>\r\n', '', 12, 1, 15, 5, 10, 0),
(180, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Điểm trung bình ở học kỳ hoặc năm học trước để xét giảm học phí đối với đối tượng anh, chị em ruột đang học tại trường là từ bao nhiêu điểm? </span></span></p>\r\n', '', 12, 1, 15, 12, 3, 0),
(181, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Danh hiệu thi đua khen thưởng đối với cá nhân dành cho Sinh viên STU đạt thành tích trong học tập và rèn luyện?</span></p>\r\n', '', 12, 1, 16, 14, 2, 0),
(182, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Xác nhận của đơn vị nào không được nhà trường công nhận khi sinh viên tham gia chương trình công tác xã hội?</span></span></p>\r\n', '', 12, 1, 8, 4, 4, 0),
(183, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Sinh viên chưa hoàn thành đủ số ngày công tác xã hội sẽ bị xử lý thế nào?</span></span></p>\r\n', '', 12, 1, 5, 3, 2, 0),
(184, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Sau khi có kết quả số ngày CTXH tạm thời sinh viên có bao nhiêu ngày để thực hiện quyền khiếu nại?</span></span></p>\r\n', '', 12, 1, 15, 7, 8, 0),
(185, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Theo quy định quy đổi ngày Công tác xã hội (CTXH), Sinh viên thực hiện công việc từ bao nhiêu giờ thì được tính 1 ngày CTXH?</span></p>\r\n', '', 12, 1, 16, 6, 10, 0),
(186, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Trong toàn khóa học Sinh viên hệ Đại học phải tích lũy đủ bao nhiêu ngày CTXH?</span></span></p>\r\n', '', 12, 1, 9, 9, 0, 0),
(187, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Quy định đánh giá kết quả rèn luyện có bao nhiêu nội dung?</span></span></p>\r\n', '', 12, 1, 7, 4, 3, 0),
(188, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Thời gian khiếu nại về kết quả đánh giá điểm rèn luyện đối với Sinh viên hệ Đại học là bao nhiêu ngày kể từ ngày công bố kết quả tạm thời?</span></p>\r\n', '', 12, 1, 10, 3, 5, 2),
(189, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Đánh giá kết quả rèn luyện của sinh viên dựa vào nội dung nào?</span></p>\r\n', '', 12, 1, 8, 5, 1, 2),
(190, 'Nhiều lựa chọn Một câu trả lời', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\">Quy trình đánh giá kết quả rèn luyện của sinh viên STU như thế nào?</span></span></span></p>\r\n', '', 12, 1, 13, 10, 1, 2),
(191, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Sinh viên không tham gia đánh giá xếp loại thể lực hoặc tham gia nhưng không đạt tiêu chuẩn đánh giá thể lực lần 2 sẽ bị xử lý như thế nào?</span></p>\r\n', '', 12, 1, 7, 4, 3, 0),
(192, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Theo quy định về việc đánh giá, xếp loại thể lực cho Sinh viên (SV) STU, mỗi SV được đánh giá bao nhiêu nội dung?</span></p>\r\n', '', 12, 1, 9, 6, 3, 0),
(193, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Sinh viên không tham gia khám sức khỏe định kỳ hàng năm do nhà trường tổ chức sẽ bị xử lý như thế nào?</span></p>\r\n', '', 12, 1, 4, 3, 1, 0),
(194, 'Nhiều lựa chọn Một câu trả lời', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Mục đích của việc Sinh viên khai báo Ngoại trú là gì?</span></span></span></span></p>\r\n', '', 12, 1, 6, 6, 0, 0),
(195, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Khi có sự thay đổi về nơi cư trú, sinh viên phải báo địa chỉ nơi cư trú của mình với nhà trường trong thời hạn bao nhiêu ngày?</span></span></p>\r\n', '', 12, 1, 4, 3, 1, 0),
(196, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Sinh viên khai báo Ngoại trú bao nhiêu lần trong năm học?</span></span></p>\r\n', '', 12, 1, 9, 7, 2, 0),
(197, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Có bao nhiêu danh hiệu khen thưởng đối với tập thể lớp sinh viên?</span></span></p>\r\n', '', 12, 1, 12, 4, 8, 0),
(198, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Theo bạn dấu hiệu khác biệt trong phương pháp học đại học so với học phổ thông là gì?</span></span></p>\r\n', '', 12, 1, 15, 9, 6, 0),
(199, 'Nhiều lựa chọn Một câu trả lời', '<p style=\"margin-left:36pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Khi cần tìm hiểu về một vấn đề bạn sẽ tìm thông tin ở đâu?</span></span></span></span></p>\r\n', '', 12, 1, 6, 6, 0, 0),
(200, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Nơi nào cung cấp các khóa học miễn phí trên internet?</span></span></p>\r\n', '', 12, 1, 16, 11, 5, 0),
(201, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Nơi nào cung cấp các khóa học miễn phí trên internet?</span></span></p>\r\n', '', 12, 1, 9, 6, 3, 0),
(202, 'Nhiều lựa chọn Một câu trả lời', '<p>Muốn học những kỹ năng thì bạn tìm ở đâu?</p>\r\n', '', 12, 1, 7, 4, 3, 0),
(203, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Sinh viên thiếu chuyên cần sẽ bị cấm thi khi nào?</span></span></p>\r\n', '', 12, 1, 17, 7, 8, 2),
(204, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Sinh viên đại học có thời gian tối đa bao nhiêu để hoàn thành chương trình đào tạo?</span></p>\r\n', '', 12, 1, 13, 11, 0, 2),
(205, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Trong chương trình đào tạo khóa 2019, một giờ tín chỉ được quy định như thế nào?</span></p>\r\n', '', 12, 1, 5, 2, 3, 0),
(206, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Sinh viên đăng ký môn học để học tập học kỳ tiếp theo. Số tín chỉ tối thiểu sinh viên có thể đăng ký trong học kỳ chính là bao nhiêu?</span></span></p>\r\n', '', 12, 1, 8, 2, 6, 0),
(207, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Một năm học tại Trường Đại học Công nghệ Sài Gòn gồm bao nhiêu học kỳ?</span></span></p>\r\n', '', 12, 1, 7, 7, 0, 0),
(208, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Tại trường Đại học Công nghệ Sài Gòn, tổng số tín chỉ cho mỗi chương trình đào tạo bậc Đại học là bao nhiêu?</span></p>\r\n', '', 12, 1, 17, 4, 11, 2),
(209, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Xếp loại Trung bình khá được đánh giá theo thang điểm 4 là bao nhiêu?</span></span></p>\r\n', '', 12, 1, 4, 1, 3, 0),
(210, 'Nhiều lựa chọn Một câu trả lời', '<p>Sinh viên tích lũy đủ học phần, tín chỉ quy định trong chương trình đào tạo sẽ được xét tốt nghiệp. Ngoài ra, sinh viên phải đạt chứng chỉ của môn học nào?</p>\r\n', '', 12, 1, 10, 9, 1, 0),
(211, 'Nhiều lựa chọn Một câu trả lời', '<p>Nhà trường phân công người cố vấn và hỗ trợ sinh viên phát huy tối đa khả năng học tập, lựa chọn môn học phù hợp, theo dõi thành tích học tập cho một sinh viên, nhóm sinh viên hay một lớp, được gọi là gì?</p>\r\n', '', 12, 1, 16, 14, 0, 2),
(212, 'Nhiều lựa chọn Một câu trả lời', '<p>Vào cuối học kỳ, nhà trường tổng hợp kết quả học tập và xử lý học vụ những sinh viên có kết quả không đạt yêu cầu dưới các hình thức nào?</p>\r\n', '', 12, 1, 18, 16, 0, 2),
(213, 'Nhiều lựa chọn Một câu trả lời', '<p>Điểm tổng kết môn học được tính dựa trên điểm thành phần nào?</p>\r\n', '', 12, 1, 18, 18, 0, 0),
(214, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Trường Đại học Công nghệ Sài Gòn được thành lập vào thời gian nào?</span></p>\r\n', '', 12, 1, 4, 4, 0, 0),
(215, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Trường hiện tại có bao nhiêu khoa đào tạo?</span></span></span></span></p>\r\n', '', 12, 1, 7, 3, 2, 2),
(216, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\">Slogan của STU là gì?</span></span></span></p>\r\n', '', 12, 1, 9, 2, 7, 0),
(217, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Sứ mệnh của STU là gì?</span></p>\r\n', '', 12, 1, 17, 14, 3, 0),
(218, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Để làm các thủ tục về học vụ, sinh viên cần liên hệ phòng ban nào?</span></span></span></span></p>\r\n', '', 12, 1, 7, 5, 2, 0),
(219, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Để liên hệ các hoạt động về nghiên cứu khoa học, sinh viên cần liên hệ phòng ban nào?</span></span></span></span></p>\r\n', '', 12, 1, 4, 1, 3, 0),
(220, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Để liên hệ hỗ trợ các giấy xác nhận cho sinh viên như hoãn nghĩa vụ quân sự, vay vốn… sinh viên cần liên hệ  phòng ban nào?</span></span></span></span></p>\r\n', '', 12, 1, 10, 8, 0, 2),
(221, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Để liên hệ hỗ trợ các vấn đề về Bảo hiểm y tế, sinh viên cần liên hệ phòng ban nào?</span></p>\r\n', '', 12, 1, 17, 2, 13, 2),
(222, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\">Để làm các hồ sơ về giảm học phí, học bổng ... sinh viên cần liên hệ phòng ban nào?</span></span></span></p>\r\n', '', 12, 1, 12, 6, 6, 0),
(223, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:13.0pt\">Tại STU, đơn vị chủ yếu tổ chức, xét duyệt các hoạt động CTXH là đơn vị nào?</span></p>\r\n', '', 12, 1, 12, 2, 10, 0),
(224, 'Nhiều lựa chọn Một câu trả lời', '<p>Môn học chứa đựng nội dung kiến thức chính yếu của mỗi chương trình mà bắt buộc sinh viên phải tích lũy gọi là gì?</p>\r\n', '', 12, 1, 10, 7, 3, 0),
(225, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Theo kiến thức đã học với giảng viên, thích nghi là gì?</span></span></span></span></p>\r\n', '', 13, 1, 26, 24, 2, 0),
(226, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Người thích nghi tốt có đặc điểm gì?</span></span></span></span></p>\r\n', '', 13, 1, 26, 3, 23, 0),
(227, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Thích nghi tốt mang đến lợi ích gì?</span></span></span></span></p>\r\n', '', 13, 1, 26, 24, 2, 0),
(228, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Để thích nghi tốt, sinh viên cần lưu ý điều gì?</span></span></span></span></p>\r\n', '', 13, 1, 26, 24, 2, 0),
(229, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Gặp khó khăn trong quá trình thích nghi, sinh viên nên nhìn nhận đó như thế nào?</span></span></span></span></p>\r\n', '', 13, 1, 26, 15, 11, 0),
(230, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Tại sao phải kiên nhẫn trong quá trình thích nghi?</span></span></span></p>\r\n', '', 13, 1, 26, 15, 11, 0),
(231, 'Nhiều lựa chọn Một câu trả lời', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Thích nghi là quá trình sẽ xảy ra khi nào?</span></span></span></span></p>\r\n', '', 13, 1, 26, 14, 12, 0),
(232, 'Nhiều lựa chọn Một câu trả lời', '<p>Tại STU, có bao nhiêu mức xử lý đối với sinh viên khi vi phạm kỷ luật?</p>\r\n', '', 12, 1, 13, 9, 4, 0),
(233, 'Nhiều lựa chọn Một câu trả lời', '<p>Có bao nhiêu danh hiệu khen thưởng đối với cá nhân sinh viên?</p>\r\n', '', 12, 1, 16, 6, 10, 0),
(234, 'Nhiều lựa chọn Một câu trả lời', '<p>Trong quy định về an ninh trật tại STU, SV khi vào trường phải chấp hành nội quy:</p>\r\n', '', 12, 1, 12, 10, 0, 2),
(235, 'Nhiều lựa chọn Một câu trả lời', '<p>Trong quy định về Văn hóa STU, Văn hóa STU được áp dụng cho các đối tượng nào?</p>\r\n', '', 12, 1, 5, 3, 2, 0),
(236, 'Nhiều lựa chọn Một câu trả lời', '<p>Có bao nhiêu giá trị văn hóa được quy định trong \"Văn hóa STU\"?</p>\r\n', '', 12, 1, 9, 3, 6, 0),
(237, 'Nhiều lựa chọn Một câu trả lời', '<p>Đối tượng áp dụng thực hiện qui định về việc thực hiện công tác xã hội tại STU?</p>\r\n', '', 12, 1, 8, 2, 6, 0),
(238, 'Nhiều lựa chọn Một câu trả lời', '<p>Quy trình tổng hợp ngày công tác xã hội (CTXH) của sinh viên như thế nào?</p>\r\n', '', 12, 1, 14, 2, 10, 2),
(239, 'Nhiều lựa chọn Một câu trả lời', '<p>Có bao nhiêu mức phân loại kết quả đánh giá rèn luyện cho sinh viên?</p>\r\n', '', 12, 1, 12, 1, 11, 0),
(240, 'Nhiều lựa chọn Một câu trả lời', '<p>Quy chế đánh giá kết quả rèn luyện của sinh viên ban hành theo quết định số 231/QĐ-DSG-CTSV ngày 01/08/2016 áp dụng cho đối tượng nào?</p>\r\n', '', 12, 1, 10, 5, 5, 0),
(241, 'Nhiều lựa chọn Một câu trả lời', '<p>Mức kỷ luật sinh viên vi phạm lần 1 đối với hành vi thi, kiểm tra thay, hoặc nhờ thi, kiểm tra thay; làm thay, nhờ làm hoặc sao chép tiểu luận, đồ án, khóa luận tốt nghiệp  theo quy chế công tác sinh viên là gì?</p>\r\n', '', 12, 1, 6, 1, 5, 0);
